Ashley (Kaylani Lei) is lighthearted, warm, and spontaneous.
Ben (Chris Cannon) is perpetually serious, exacting and guided by rules.
After four years of living together, Ashley begins to feel suffocated by how serious and inflexible their lives have become. She loves him with every inch of her being, but will love be enough?
